import React from 'react'
import { Form, Icon, Input, Button, Checkbox} from 'antd';
import { DatePicker, Radio } from 'antd';
import { Row, Col } from 'antd';

const FormItem = Form.Item;
const { MonthPicker, RangePicker, WeekPicker } = DatePicker;

const inintialState = { 
    studentname:'',
    currentDate:'',
    classes:'',
    rollnumber: "",
    size: '',


  }

class Register extends React.Component{
    state = {...inintialState}

    onChange= (event, date, dateString)=>{
        console.log(date, dateString);
        this.setState({
            currentDate:dateString
        })
      }
      handleSizeChange = (e) => {
        this.setState({ size: e.target.value });
      }

      handleChange=(event)=>{
        const { name, value } = event.target;
        console.log(name, value);
        this.setState({[name]: value})
      }
handleSubmit=(event)=>{
    console.log(this.state)
}

    render(){
        const { studentname, size, classes,rollnumber } =this.state
        return(
            <div >

            <image src={{backgroundImage:'../image/background.jpg'}}></image>

              <Row>
              <Col span={12} offset={6}>

              <div className="login-form{" style={{display:"flex"}}>
              <div style={{margin:130}}>


            <Form className="login-form" style={{ width:400, backgroundColor:'white'}} > 
          <div style={{paddingTop:30}}>
            <strong><span className="login100-form-title p-b-51" style={{paddingLeft:80}}>
            <img style={{width:80}} src={require( '../image/student.jpeg')} alt="" />
                    Register 
                  </span></strong></div>
               <FormItem style={{paddingLeft:50, paddingTop:50}}> 
              <FormItem>

                  <Input className='input-sigin'
                  name='studentname'
                  value={studentname}
                  onChange={event => this.handleChange(event)}
                  placeholder="Student Name" />
              </FormItem>
              <FormItem>

              <div>

              <Radio.Group value={size} onChange={this.handleSizeChange}>
        </Radio.Group>

        <DatePicker size={size} />



            </div>
              </FormItem>
              <FormItem>

                <Input className='input-sigin'
                name='classes'
                value={classes}
                onChange={event => this.handleChange(event)}
                placeholder="Class" />
            </FormItem>
            <FormItem>

                <Input className='input-sigin'
                name='rollnumber'
                value={rollnumber}
                onChange={event => this.handleChange(event)}

                placeholder="Roll Number" />
            </FormItem>
              </FormItem>



                <FormItem style={{ paddingLeft:80}}>
                <Button type="primary" htmlType="submit" 
                className="login-form-button" style={{ width:210, paddingLeft:50}} 


                 onClick={event =>this.handleSubmit(event)}
                >
                <Icon type="login"/>
                  Submit
                </Button>
                <FormItem>
                {/* {error && <Result
                    type="error"
                    title="Error"
                    description={error.message}
                    actions={<Button size="large" type="primary">OK</Button>}
                  />} */}

                      </FormItem>
                </FormItem>

            </Form>

            </div>
            </div>
            </Col>
            </Row>


            </div>


        )
    }
}

export default Register;
